import React  from 'react';
import img from './samples/receipt.png'

const Box=(props)=>{
    return(

        <>
        <div className="container">
      <div className="filter-img">
      <img src={img} alt="CAR"></img>

          
      </div>

            
        </div>


        </>
    )




}
export default Box
